import React from "react";
import Card from "./Card.jsx";
import contacts from "../contacts.js";

function App() {
  return (
    <div>
     <h1 className="heading">My Contacts</h1>
     {contacts.map((contact,index) => (
                   <Card
                       key = {contact.index}
                       name = {contact.name}
                       img = {contact.imgURL}
                       tel = {contact.phone}
                       email = {contact.email}
                       />
                   ))
     }
    </div>
  );
}

export default App;
